import * as actionTypes from './types'
import { type } from 'os';

export interface Planet {
  name:string,
  distance:number
}

export type PlanetAction = {
  type:actionTypes.PLANET_ACTION,
  payload:Planet[]
}

export const planetAction=(payload:Planet[]):PlanetAction => {
  return {
    type:actionTypes.PLANET_ACTION,
    payload
    };
}
export type ReduxActions= PlanetAction;
